prediction.sparql:
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT DISTINCT ?person ?personLabel ?dateOfDeath ?archiveInstitution ?archiveInstitutionLabel WHERE {
  VALUES ?gender {
    wd:Q6581072
  }
  VALUES ?place {
    wd:Q3240
  }
  ?person wdt:P21 ?gender .
  {
    ?person wdt:P19 ?place
  } UNION {
    ?person wdt:P20 ?place
  }
  ?person wdt:P570 ?dateOfDeath .
  FILTER ( ?dateOfDeath < "1948-01-01" ^^ xsd:dateTime ) OPTIONAL {
    ?person wdt:P1065 ?archiveInstitution .
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel .
    FILTER ( LANG( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?archiveInstitution rdfs:label ?archiveInstitutionLabel .
    FILTER ( LANG( ?archiveInstitutionLabel ) = "en" )
  }
}

PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT DISTINCT ?person ?personLabel ?netWorthAmount ?netWorthUnit ?netWorthInUSD WHERE {
  ?person wdt:P21 wd:Q6581072 .
  ?person p:P2218 ?netWorthStatement .
  ?netWorthStatement ps:P2218 ?netWorthAmount .
  OPTIONAL {
    ?netWorthStatement pq:P2093 ?netWorthUnit .
  }
  BIND( IF( BOUND( ?netWorthUnit ) , ?netWorthAmount , ?netWorthAmount ) AS ?netWorthInUSD ) FILTER ( ?netWorthInUSD >= 1000000000 ) OPTIONAL {
    ?person rdfs:label ?personLabel .
    FILTER ( LANG( ?personLabel ) = 'en' )
  }
}
ORDER BY DESC ( ?netWorthInUSD )

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?numPartners ( COUNT( ?femaleArtist ) AS ?numFemaleArtists ) ( 0 AS ?numMaleArtists ) WHERE {
  ?artist wdt:P106 wd:Q108289408 .
  ?artist wdt:P21 wd:Q6581072 .
  OPTIONAL {
    ?artist wdt:P451 ?partner .
  }
  .
  BIND( ?artist AS ?femaleArtist ) .
  BIND( COUNT( ?partner ) AS ?numPartners )
}
GROUP BY ?numPartners

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?version ?publicationDate WHERE {
  wd:Q83 p:P348 ?statement .
  ?statement ps:P348 ?version .
  OPTIONAL {
    ?statement pq:P577 ?publicationDate
  }
}
ORDER BY ?publicationDate

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?lighthouse WHERE {
  ?lighthouse wdt:P31 wd:Q244494 .
  ?lighthouse wdt:P131 wd:Q504676 .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?goat ?goatLabel ?image ?startTime ( COALESCE ( ?end , NOW () ) AS ?endTime ) WHERE {
  wd:Q151345 wdt:P161 ?goat .
  OPTIONAL {
    ?goat wdt:P18 ?image
  }
  OPTIONAL {
    ?goat wdt:P569 ?startTime
  }
  OPTIONAL {
    ?goat wdt:P570 ?end
  }
  FILTER ( ISIRI( ?goat ) ) OPTIONAL {
    ?goat rdfs:label ?goatLabel .
    FILTER ( LANG( ?goatLabel ) = 'en' )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?mountain ?mountainLabel ?elevation WHERE {
  VALUES ?mountain {
    wd:Q513 wd:Q43512
  }
  ?mountain wdt:P31 wd:Q8502 .
  ?mountain wdt:P2044 ?elevation .
  ?mountain rdfs:label ?mountainLabel .
  FILTER ( LANG( ?mountainLabel ) = "en" )
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?event ?tournament WHERE {
  ?event wdt:P2416 wd:Q16893072 .
  ?event wdt:P118 ?tournament .
  ?tournament wdt:P118 ?tour .
  FILTER ( ?tour = wd:Q300008 || ?tour = wd:Q3775082 ) FILTER NOT EXISTS {
    ?event wdt:P1346 ?winner
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?person ?personLabel ?dateOfDeath ?familySearchID ?father ?fatherLabel WHERE {
  ?person wdt:P27 wd:Q135 .
  ?person wdt:P570 ?dateOfDeath .
  ?person wdt:P2889 ?familySearchID .
  ?person wdt:P22 ?father .
  FILTER NOT EXISTS {
    ?father wdt:P2889 ?fatherFamilySearchID
  }
  .
  OPTIONAL {
    ?person rdfs:label ?personLabel .
    FILTER ( LANG( ?personLabel ) = "en" )
  }
  .
  OPTIONAL {
    ?father rdfs:label ?fatherLabel .
    FILTER ( LANG( ?fatherLabel ) = "en" )
  }
}
LIMIT 10

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?book ( SAMPLE( ?label ) AS ?bookLabel ) WHERE {
  ?book wdt:P50 wd:Q35610 .
  OPTIONAL {
    ?book rdfs:label ?label .
  }
}
GROUP BY ?book

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?state ?stateLabel ?coordinates ( GROUP_CONCAT( DISTINCT ?languageLabel ; SEPARATOR = ", " ) AS ?languages ) WHERE {
  ?state wdt:P31 wd:Q3624078 .
  ?state wdt:P625 ?coordinates .
  ?state wdt:P37 ?language .
  OPTIONAL {
    ?state rdfs:label ?stateLabel .
    FILTER ( LANG( ?stateLabel ) = "en" )
  }
  OPTIONAL {
    ?language rdfs:label ?languageLabel .
    FILTER ( LANG( ?languageLabel ) = "en" )
  }
}
GROUP BY ?state ?stateLabel ?coordinates

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?item ?yearOfCreation ?commemoratedEntity ?image ?coordinates WHERE {
  ?item wdt:P1435 [] .
  ?item wdt:P131 wd:Q1757 .
  OPTIONAL {
    ?item wdt:P571 ?yearOfCreation .
  }
  OPTIONAL {
    ?item wdt:P547 ?commemoratedEntity .
  }
  OPTIONAL {
    ?item wdt:P18 ?image .
  }
  OPTIONAL {
    ?item wdt:P625 ?coordinates .
  }
}
ORDER BY ?item

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?player WHERE {
  ?player wdt:P31 wd:Q5 ; wdt:P641 wd:Q11311 ; wdt:P27 wd:Q31 .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?subclass ?subclassLabel WHERE {
  ?subclass rdfs:subClassOf * wd:Q87167 .
  OPTIONAL {
    ?subclass rdfs:label ?subclassLabel .
    FILTER ( LANG( ?subclassLabel ) = 'en' )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?property ?propertyLabel ?value ?valueLabel WHERE {
  wd:Q9696 ?property ?value .
  OPTIONAL {
    ?property rdfs:label ?propertyLabel .
    FILTER ( LANG( ?propertyLabel ) = "en" )
  }
  OPTIONAL {
    ?value rdfs:label ?valueLabel .
    FILTER ( LANG( ?valueLabel ) = "en" )
  }
}
LIMIT 100

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?category ?categoryLabel ( COUNT( ?unit ) AS ?count ) WHERE {
  ?unit wdt:P17 wd:Q142 .
  ?unit wdt:P31 ?category .
  FILTER EXISTS {
    ?category wdt:P31 wd:Q4167410
  }
  .
  OPTIONAL {
    ?category rdfs:label ?categoryLabel .
    FILTER ( LANG( ?categoryLabel ) = "fr" )
  }
}
GROUP BY ?category ?categoryLabel
HAVING ( ?count > 499 )
ORDER BY DESC ( ?count )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?city ?cityLabel ?population ?coordinates WHERE {
  ?city wdt:P1082 ?population ; wdt:P625 ?coordinates ; wdt:P17 wd:Q159 ; wdt:P31 wd:Q515 .
  FILTER ( ?population > 100000 ) OPTIONAL {
    ?city rdfs:label ?cityLabel .
    FILTER ( LANG( ?cityLabel ) = 'en' )
  }
}
ORDER BY DESC ( ?population )
LIMIT 100

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?volume ?japaneseTitle ?volumeNumber ?publicationDate WHERE {
  wd:Q3853685 wdt:P527 ?volume .
  OPTIONAL {
    ?volume rdfs:label ?japaneseTitle FILTER ( LANG( ?japaneseTitle ) = 'ja' )
  }
  OPTIONAL {
    ?volume wdt:P478 ?volumeNumber
  }
  OPTIONAL {
    ?volume wdt:P577 ?publicationDate
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?country ?countryLabel ?capital ?capitalLabel ?currency ?currencyLabel ?population ?flagImage ?inceptionDate WHERE {
  ?country wdt:P31 wd:Q3624078 ; wdt:P36 ?capital ; wdt:P38 ?currency ; wdt:P1082 ?population ; wdt:P41 ?flagImage .
  OPTIONAL {
    ?capital wdt:P571 ?inceptionDate
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel .
    FILTER ( LANG( ?countryLabel ) = "en" )
  }
  OPTIONAL {
    ?capital rdfs:label ?capitalLabel .
    FILTER ( LANG( ?capitalLabel ) = "en" )
  }
  OPTIONAL {
    ?currency rdfs:label ?currencyLabel .
    FILTER ( LANG( ?currencyLabel ) = "en" )
  }
  FILTER NOT EXISTS {
    ?country wdt:P31 wd:Q3024240
  }
  FILTER NOT EXISTS {
    ?country wdt:P31 wd:Q34645
  }
}
LIMIT 100

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?country ?countryLabel ?flagImage ?population WHERE {
  ?country wdt:P31 wd:Q6256 ; wdt:P41 ?flagImage ; wdt:P1082 ?population .
  OPTIONAL {
    ?country rdfs:label ?countryLabel .
    FILTER ( LANG( ?countryLabel ) = "en" )
  }
}
ORDER BY DESC ( ?population )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?article ?title WHERE {
  ?article wdt:P1433 wd:Q15817086 .
  FILTER NOT EXISTS {
    ?article rdfs:label ?label .
    FILTER ( LANG( ?label ) = "en" )
  }
  OPTIONAL {
    ?article rdfs:label ?title .
    FILTER ( LANG( ?title ) = "en" )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?unit ?unitLabel ?part ?partLabel ?largerUnit ?largerUnitLabel ?geolexID WHERE {
  ?unit wdt:P31 wd:Q3550897 .
  ?unit wdt:P131 wd:Q816 .
  OPTIONAL {
    ?unit wdt:P527 ?part .
    ?part rdfs:label ?partLabel .
    FILTER ( LANG( ?partLabel ) = "en" )
  }
  OPTIONAL {
    ?unit wdt:P361 ?largerUnit .
    ?largerUnit rdfs:label ?largerUnitLabel .
    FILTER ( LANG( ?largerUnitLabel ) = "en" )
  }
  OPTIONAL {
    ?unit wdt:P2427 ?geolexID
  }
  OPTIONAL {
    ?unit rdfs:label ?unitLabel .
    FILTER ( LANG( ?unitLabel ) = "en" )
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?tournament ?country ?endTime ?location ?editionNumber ?pointInTime ?surface WHERE {
  ?tournament wdt:P361 wd:Q300008 .
  ?tournament wdt:P585 ?pointInTime .
  FILTER ( YEAR( ?pointInTime ) = 2018 ) .
  OPTIONAL {
    ?tournament wdt:P17 ?country .
  }
  OPTIONAL {
    ?tournament wdt:P582 ?endTime .
  }
  OPTIONAL {
    ?tournament wdt:P276 ?location .
  }
  OPTIONAL {
    ?tournament wdt:P374 ?editionNumber .
  }
  OPTIONAL {
    ?tournament wdt:P1071 ?surface .
  }
}
ORDER BY ASC ( ?endTime )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?ruralCommune ?ruralCommuneLabel WHERE {
  ?ruralCommune wdt:P31 wd:Q17318027 .
  OPTIONAL {
    ?ruralCommune rdfs:label ?ruralCommuneLabel FILTER ( LANG( ?ruralCommuneLabel ) = 'en' )
  }
}
LIMIT 500

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?property ?object WHERE {
  wd:Q1055 ?property ?object .
  VALUES ?property {
    wdt:P856 wdt:P625 wdt:P131
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?human WHERE {
  ?human wdt:P31 wd:Q5 .
  ?human wdt:P19 ?placeOfBirth .
  {
    ?placeOfBirth wdt:P17 wd:Q408 .
  } UNION {
    ?placeOfBirth wdt:P31 wd:Q6256 .
    ?placeOfBirth wdt:P17 wd:Q408 .
  }
  FILTER NOT EXISTS {
    ?human wdt:P21 ?gender .
  }
}

PREFIX pr: <http://www.wikidata.org/prop/reference/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX prov: <http://www.w3.org/ns/prov#>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?year ?numPassengers ?referenceURL ?referenceType WHERE {
  wd:Q223416 p:P3872 ?statement .
  ?statement ps:P3872 ?numPassengers .
  ?statement pq:P585 ?year .
  ?statement prov:wasDerivedFrom ?referenceNode .
  ?referenceNode pr:P854 ?referenceURL .
  OPTIONAL {
    ?referenceNode pr:P3452 ?referenceType .
  }
  FILTER NOT EXISTS {
    ?statement wikibase:rank wikibase:DeprecatedRank
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?item ?itemLabel ?creator ?creatorLabel ?placeOfBirth ?placeOfBirthLabel ?inventoryNumber ?image WHERE {
  ?item wdt:P195 ?collection .
  ?collection wdt:P361 wd:Q3329624 .
  OPTIONAL {
    ?item wdt:P170 ?creator .
    OPTIONAL {
      ?creator wdt:P19 ?placeOfBirth .
      FILTER EXISTS {
        ?placeOfBirth wdt:P131 * wd:Q414
      }
      .
    }
    OPTIONAL {
      ?item wdt:P217 ?inventoryNumber .
    }
    OPTIONAL {
      ?item wdt:P18 ?image .
    }
  }
  OPTIONAL {
    ?item rdfs:label ?itemLabel .
    FILTER ( LANG( ?itemLabel ) = 'en' )
  }
  OPTIONAL {
    ?creator rdfs:label ?creatorLabel .
    FILTER ( LANG( ?creatorLabel ) = 'en' )
  }
  OPTIONAL {
    ?placeOfBirth rdfs:label ?placeOfBirthLabel .
    FILTER ( LANG( ?placeOfBirthLabel ) = 'en' )
  }
}
LIMIT 100

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?session ?constituency ?constituencyLabel ?expectedSeats ?actualSeats WHERE {
  wd:Q21084449 wdt:P527 ?session .
  ?session wdt:P39 ?position .
  ?position wdt:P31 wd:Q16707842 .
  ?position wdt:P768 ?constituency .
  OPTIONAL {
    ?constituency wdt:P1342 ?expectedSeats
  }
  OPTIONAL {
    ?constituency wdt:P1342 ?actualSeats
  }
  FILTER ( ?actualSeats > 1 ) ?constituency rdfs:label ?constituencyLabel .
  FILTER ( LANG( ?constituencyLabel ) = "en" )
}

PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?person ?personLabel ?office ?officeLabel ?dob ?placeOfBirth ?placeOfBirthLabel ?gender ?genderLabel ?start ?end WHERE {
  ?person wdt:P39 ?office .
  ?office wdt:P279 * wd:Q1538785 .
  ?person wdt:P569 ?dob .
  OPTIONAL {
    ?person wdt:P19 ?placeOfBirth .
  }
  OPTIONAL {
    ?person wdt:P21 ?gender .
  }
  OPTIONAL {
    ?person p:P39 ?positionStatement .
    ?positionStatement pq:P580 ?start .
    ?positionStatement pq:P582 ?end .
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel .
    FILTER ( LANG( ?personLabel ) = 'en' )
  }
  OPTIONAL {
    ?office rdfs:label ?officeLabel .
    FILTER ( LANG( ?officeLabel ) = 'en' )
  }
  OPTIONAL {
    ?placeOfBirth rdfs:label ?placeOfBirthLabel .
    FILTER ( LANG( ?placeOfBirthLabel ) = 'en' )
  }
  OPTIONAL {
    ?gender rdfs:label ?genderLabel .
    FILTER ( LANG( ?genderLabel ) = 'en' )
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?item ?url WHERE {
  ?item wdt:P856 ?url .
  FILTER ( CONTAINS( ?url , 'twitter.com' ) || CONTAINS( ?url , 'x.com' ) )
}
LIMIT 100

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?business ?businessLabel ?headquarters WHERE {
  ?business wdt:P159 wd:Q213 .
  FILTER ( ?business != wd:Q100707321 && ?business != wd:Q12021780 ) .
  OPTIONAL {
    ?business rdfs:label ?businessLabel .
    FILTER ( LANG( ?businessLabel ) = 'en' ) .
  }
  OPTIONAL {
    ?business wdt:P159 ?headquarters .
  }
}
LIMIT 20

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?country ?countryLabel ( MAX( ROUND( ?area ) ) AS ?roundedArea ) ( GROUP_CONCAT( DISTINCT STR( ?partOfLabel ) ; SEPARATOR = ', ' ) AS ?parts ) WHERE {
  ?country wdt:P31 / wdt:P279 * wd:Q3624078 ; wdt:P30 wd:Q46 ; wdt:P2046 ?area .
  FILTER NOT EXISTS {
    ?country wdt:P576 [] .
  }
  FILTER NOT EXISTS {
    ?country wdt:P31 / wdt:P279 * wd:Q39576 .
  }
  FILTER NOT EXISTS {
    ?country wdt:P31 / wdt:P279 * wd:Q1174213 .
  }
  OPTIONAL {
    ?country wdt:P361 ?partOf .
    ?partOf rdfs:label ?partOfLabel .
    FILTER ( LANG( ?partOfLabel ) = 'en' )
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel .
    FILTER ( LANG( ?countryLabel ) = 'en' )
  }
}
GROUP BY ?country ?countryLabel
ORDER BY DESC ( ?roundedArea )
LIMIT 100

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?entity ?entityLabel ?population ?area WHERE {
  VALUES ?entity {
    wd:Q884 wd:Q31057 wd:Q35555 wd:Q220982 wd:Q31063 wd:Q475038
  }
  ?entity wdt:P1082 ?population .
  ?entity wdt:P2046 ?area .
  FILTER NOT EXISTS {
    ?entity wdt:P31 / wdt:P279 * wd:Q1142547 .
  }
  FILTER NOT EXISTS {
    ?entity wdt:P31 / wdt:P279 * wd:Q191580 .
  }
  FILTER NOT EXISTS {
    ?entity wdt:P31 / wdt:P279 * wd:Q191581 .
  }
  FILTER NOT EXISTS {
    ?entity wdt:P31 / wdt:P279 * wd:Q1142548 .
  }
  OPTIONAL {
    ?entity rdfs:label ?entityLabel .
    FILTER ( LANG( ?entityLabel ) = "en" )
  }
}
ORDER BY DESC ( ?population )

PREFIX pqv: <http://www.wikidata.org/prop/qualifier/value/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?item ?owner ?startTime ?endTime WHERE {
  ?ship wdt:P1476 "Edward John" @en .
  ?ship wdt:P127 ?owner .
  ?item wdt:P127 ?owner .
  OPTIONAL {
    ?item p:P127 / psv:P127 / pqv:P580 ?startTime .
  }
  OPTIONAL {
    ?item p:P127 / psv:P127 / pqv:P582 ?endTime .
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?destroyer ?vesselClass ?operator WHERE {
  ?destroyer wdt:P31 wd:Q2607934 .
  ?destroyer wdt:P137 ?operator .
  ?destroyer wdt:P31 ?vesselClass .
  FILTER NOT EXISTS {
    ?vesselClass wdt:P137 ?operator .
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
