SELECT ?award ?year ?country ?surface ?prizeMoney ?participants WHERE {
  wd:Q182736 wdt:P166 ?award .
  ?award wdt:P31 wd:Q11365 .
  VALUES ?tournament {
    wd:Q19238 wd:Q19240 wd:Q19241 wd:Q19242
  }
  .
  ?award wdt:P31 ?tournament .
  OPTIONAL {
    ?award wdt:P585 ?year .
  }
  OPTIONAL {
    ?award wdt:P17 ?country .
  }
  OPTIONAL {
    ?award wdt:P1079 ?surface .
  }
  OPTIONAL {
    ?award wdt:P2121 ?prizeMoney .
  }
  OPTIONAL {
    ?award wdt:P1104 ?participants .
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?candidate WHERE {
  VALUES ?election {
    wd:Q93307086 wd:Q93307088 wd:Q93307089 wd:Q93307085 wd:Q96279006
  }
  ?election wdt:P726 ?candidate .
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ( COUNT( ?person ) AS ?count ) WHERE {
  ?person wdt:P21 wd:Q6581072 ; wdt:P19 wd:Q668 .
}
